var email = "";
var esqResult = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "Contact");
var colEmail = esqResult.AddColumn("Email");

var entity = esqResult.GetEntity(UserConnection, Get<Guid>("ContactId"));
Set("ContactEmail", entity.GetColumnValue(colEmail.Name).ToString());

return true;

var transactionMessagesSchema = UserConnection.EntitySchemaManager.GetInstanceByName("UsrTransactionMessages");
var entity = transactionMessagesSchema.CreateEntity(UserConnection);
entity.SetDefColumnValues();
entity.SetColumnValue("UsrTypeId", Get<Guid>("transactionMessageTypeId"));
entity.SetColumnValue("UsrNumber", Get<string>("ContactEmail"));
entity.SetColumnValue("UsrMessage", Get<string>("TransactionMessage"));
entity.SetColumnValue("UsrDate", DateTime.Now);
entity.SetColumnValue("UsrTransactionId", Get<Guid>("TransactionId"));

entity.Save();

return true;
